class AddTodo extends React.Component {
    render() {
      return (
        <form  style={{display: 'flex'}}>
            <input 
                type="text"
                name="title"
                placeholder="Add Todo"
                style={{ margin: '10px', width: '190px', padding: '5px'}}></input>
            <input
                type="button"
                value="ADD"
                style={{ margin: '10px', width: '70px', borderRadius: '50px', backgroundColor: '#333', color: 'white'}}></input>
        </form>
        
      );
    }
  }
  
  export default AddTodo;
